import React, { Component } from 'react';
import {connect} from 'react-redux'
import {fetchFiles,fetchBranches,fetchPull,fetchIssues} from './../../actions/repo.actions'
//fetchSRC,fetchRepo
import {getFiles,getRepo,getBranches,getPulls,getID,getIssues,getCID} from './../../reducers/repo.reducer';
import {newBranch,newPull} from './../../actions/repo.actions';
import Select from '@material-ui/core/Select';
import MenuItem from '@material-ui/core/MenuItem';
import FormControl from '@material-ui/core/FormControl';
import Eos from 'eosjs';
import NewMessage from './components/newMessage'
import Icon from 'react-icons-kit';
import {star} from 'react-icons-kit/fa/star'
import {starO} from 'react-icons-kit/fa/starO'
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import PullTab from './components/pullTab';
import Typography from '@material-ui/core/Typography';
import {ecommerce_money} from 'react-icons-kit/linea/ecommerce_money'
import {arrows_question} from 'react-icons-kit/linea/arrows_question'
import {music_diapason} from 'react-icons-kit/linea/music_diapason'
import {basic_pencil_ruler} from 'react-icons-kit/linea/basic_pencil_ruler'
import Card from '@material-ui/core/Card';
import AppBar from '@material-ui/core/AppBar';
import Files from './components/files';
import Issues from './components/issues';
import QA from './components/qa';
import PullRequests from './components/pullRequests';
import Contracts from './components/contracts'

let eosConfig = {
  httpEndpoint: 'http://ec2-34-227-77-165.compute-1.amazonaws.com:8888',
}

let eos = Eos(eosConfig);

const e = async (repo) => {return await eos.getTableRows(true,repo,repo,"metatable")
  .then(rows=>{return rows.rows})}

function TabContainer(props) {
  return (
    <Typography component="div">
      {props.children}
    </Typography>
  );
}

class RepoPage extends Component {
  constructor(props){
    super(props);
    this.props.dispatch(fetchFiles(this.props.match.params.user,this.props.match.params.repo));
    this.handleFile=this.handleFile.bind(this);
    this.handleIssue=this.handleIssue.bind(this);
    this.handlePull=this.handlePull.bind(this);
    this.getBranches=this.getBranches.bind(this);
    this.newBranch=this.newBranch.bind(this);
    this.submitPull=this.submitPull.bind(this);
    this.closeMe = this.closeMe.bind(this);
    this.newIssue=this.newIssue.bind(this);
    this.handleLinkChange=this.handleLinkChange.bind(this);
    this.handleLike=this.handleLike.bind(this);
    this.handleBalance=this.handleBalance.bind(this);
    this.handleTabChange=this.handleTabChange.bind(this);
    this.state={
      closeMe: false,
      link: "SSH",
      liked: false,
      a:"-",
      value: 0,
    }
  }
  handleTabChange  (event, value)  {
    this.setState({ value });
  };
  handleLike(){
    if (this.state.liked) {
      this.setState({liked:false})
    } else {
      this.setState({liked:true})
    }
  }
  handleLinkChange  (event)  {
    this.setState({link: event.target.value})
  }
  newIssue(){
    this.props.history.push(`/newissue/${this.props.info.repoID}`);
  }
  closeMe(){
    this.setState({closeMe:true });
  }
  submitPull(name,desc,target,source){
    this.props.dispatch(newPull(name,desc,target,source,this.props.info.repoID));
  }
  handleFile(id,name){
    this.props.history.push(`${this.props.match.url}/file/${id}/${name}`);
  }
  handlePull(id){
    this.props.history.push(`${this.props.match.url}/pull/${id}`);
  }
  handleIssue(id){
    this.props.history.push(`${this.props.match.url}/issue/${id}`);
  }
  async handleBalance(){
    let a = await e(this.props.cid);
    console.log("An",a);
    this.setState({a:a[0].running_balance})
  }
  getBranches(){
    this.props.dispatch(fetchBranches(this.props.info.repoID))
  }
  newBranch(SourceBranch, NewBranch){
    this.props.dispatch(newBranch(this.props.info.repoID, SourceBranch, NewBranch))
  }
  render() {
    if(this.props.cid!==false && this.state.a==="-") this.handleBalance();
    if((!this.props.pulls||this.props.pulls===undefined)&&this.props.id!==false) {
      this.props.dispatch(fetchPull(this.props.id));
    }
    if((!this.props.issues||this.props.issues===undefined)&&this.props.id!==false) {
      this.props.dispatch(fetchIssues(this.props.id));
    }
    if(!this.props.repo || this.props.repo ===undefined || this.props.info ===undefined) return <div style={{display:"flex", justifyContent:"center", marginTop:"20vh"}}><h1>Loading</h1></div>
    if(this.props.repo.empty) return <NewMessage repo={this.props.repo}/>
    return (
      <div className="RepoPage">
        <div className="Header">
          <div className="Title">
            <Typography id="overline">Project</Typography>
            <Typography variant="display4">{this.props.match.params.repo}</Typography>
          </div>
          <div className="Info">
            <div className="GitLink">
              <Card className="Card">
                <FormControl className="Form">
                  <Select
                    value={this.state.link}
                    onChange={this.handleLinkChange}
                    inputProps={{
                      name: 'link',
                      id: 'link-simple',
                    }}
                  >
                    <MenuItem value={"SSH"}>SSH</MenuItem>
                    <MenuItem value={"HTTPS"}>HTTPS</MenuItem>
                  </Select>
                </FormControl>
                {(this.state.link === "SSH") && (
                  <pre>{this.props.info.ssh_url}</pre>
                )}
                {(this.state.link === "HTTPS") && (
                  <pre>{this.props.info.http_url}</pre>
                )}
              </Card>
            </div>
            <div className="Stats">
              <div className="StatDiv">
                <Icon icon={basic_pencil_ruler} size={18}/>
                <Typography variant="caption" className="Stat">Language</Typography>
              </div>
              <div className="StatDiv">
                <Icon icon={music_diapason} size={18}/>
                <Typography variant="caption" className="Stat">{this.props.info.forks_count}</Typography>
              </div>
              <div className="StatDiv">
                <Icon icon={arrows_question} size={18}/>
                <Typography variant="caption" className="Stat">x</Typography>
              </div>
              <div className="StatDiv">
                <Icon icon={ecommerce_money} size={18}/>
                <Typography variant="caption" className="Stat">{this.state.a}</Typography>
              </div>
              <div className="StatDiv">
                {this.state.liked && (<Icon icon={star} onClick={this.handleLike} style={{cursor:"pointer"}}/>)}
                {!this.state.liked && (<Icon icon={starO} onClick={this.handleLike} style={{cursor:"pointer"}}/>)}
                <Typography variant="caption" className="Stat">{this.props.info.star_count}</Typography>
              </div>
            </div>
          </div>
        </div>
        <div className="Tabs">
          <Card>
            {!this.state.closeMe &&this.props.pulls!==undefined && this.props.pulls!==false && this.props.pulls.length>0&&<div><PullTab closeMe={this.closeMe} pull = {this.props.pulls[0]}/></div>}
            <AppBar position="static" elevation={0} color="primary">
              <Tabs value={this.state.value} onChange={this.handleTabChange} fullWidth indicatorColor="primary">
                <Tab label="Files" />
                <Tab disabled label="Issues" />
                <Tab disabled label="Merge Requests" />
                <Tab disabled label="Q&A" />
                <Tab disabled label="Contract" />
              </Tabs>
            </AppBar>
            {this.state.value === 0 && <TabContainer className="TabContent"><Files submitPull={this.props.submitPull} branches={this.props.branches} id={this.props.id} files={this.props.repo} getBranches={this.getBranches} handleFile={this.handleFile} handleNewBranch={this.props.handleNewBranch} newBranch={this.props.newBranch}/></TabContainer>}
            {this.state.value === 1 && <TabContainer className="TabContent"><Issues issues={this.props.issues} handleIssue={this.props.handleIssue} newIssue={this.props.newIssue} repoID={this.props.id}/></TabContainer>}
            {this.state.value === 2 && <TabContainer className="TabContent"><PullRequests pulls={this.props.pulls} handlePull={this.props.handlePull} repo={this.props.repo} user={this.props.user}/></TabContainer>}
            {this.state.value === 3 && <TabContainer className="TabContent"><QA/></TabContainer>}
            {this.state.value === 4 && <TabContainer className="TabContent"><Contracts/></TabContainer>}
          </Card>
        </div>
      </div>
    );
  }
}

const mapStateToProps = (state) => {
  return {
    repo: getFiles(state),
    info: getRepo(state),
    branches: getBranches(state),
    pulls: getPulls(state),
    id: getID(state),
    cid: getCID(state),
    issues:getIssues(state)
    }
}


export default connect(mapStateToProps)(RepoPage);



